import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
//import Index from "../screens/Index";
// import Smart from "../screens/Smart";
// import SmartGo from "../screens/SmartGo";
// import Profile from "../screens/Profile";
import SmartStack from "./SmartStack";
import SmartGoStack from "./SmartGoStack";
import IndexStack from "./IndexStack";
import { Icon } from "react-native-elements";
import ProfileStack from "./ProfileStack";

const Tab = createBottomTabNavigator();

export default function Navigation() {
  return (
    <NavigationContainer>

    </NavigationContainer>
  );
}

function screenIcon(route, color) {
  let icono;
  switch (
    route.name //Indica la ruta en donde esta posicionado
  ) {
    case "index":
      icono = "home-outline";
      break;

    case "smart":
      icono = "weight-lifter";
      break;

    case "smart-go":
      icono = "google";
      break;

    case "profile":
      icono = "account-outline";
      break;
    default:
      break;
  }

  return (
    <Icon type="material-community" name={icono} size={24} color={color}></Icon>
  );
}
